  render(){
    return(
      <div className="HostForm">
        <div className="HostForm-header">
          <ProgressBar />
        </div>

        <div className="HostForm-content">
        <NavLink to="/BecomeAHost">back</NavLink>
        <Button type = "submit" value="Submit"><NavLink to="/"/></Button>
        </div>
      </div>

    );
  }
}
export default HostForm;
